import React from 'react';

const Acerca = () => {
  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: 'auto', fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif", color: '#333' }}>
      <h2>Acerca de Diseños Stely</h2>
      <p>
        Diseños Stely es una empresa norte santandereana, orgullosamente cucuteña, con más de 20 años de experiencia en el sector de la moda.
      </p>
      <p>
        Nos especializamos en moda europea de alta calidad, enfocándonos en ropa interior y prendas para caballeros, niños y niñas, con un fuerte compromiso con la calidad y la elegancia.
      </p>
      <p>
        Diseñamos y fabricamos tanto nuestras propias marcas como productos para marcas externas, con un enfoque local para Cúcuta y una visión de expansión hacia Colombia y el exterior.
      </p>
      <p>
        Nuestra misión es vestir a toda la familia con estilo, confort y materiales seleccionados, asegurando durabilidad y elegancia en cada prenda.
      </p>
      <p>
        Gracias por confiar en Diseños Stely, llevando moda cucuteña con orgullo al mundo.
      </p>
    </div>
  );
};

export default Acerca;
